bio:
Личные качества:
● Высоко обучаема, быстро осваиваю программы, имею опыт работы с разными сферами деятельности;
● В работе нацелена на результат;
● Способна быть эффективной в командной и персональной работе;
● Владею навыками анализа данных, визуализации, описания бизнес-процессов, постановки требований с использованием современных инструментов;
● Высокий уровень самоорганизации и личной дисциплины.
Обо мне:
      Анализ внутренних документов, проведение интервью со стейкхолдерами, описание бизнес-процесса as is и to be (Miro, Drive.io, Visio), подготовка предложений по оптимизации и автоматизации, формирование матриц разграничения прав и обязанностей. 
  Работа с требованиями (сбор, анализ, согласование, оценка, декомпозиция…), подготовка и согласование постановок задач разработчикам (Use case, User story...), митигирование рисков. 
Визуализация бизнес процессов, диаграмм в различных нотацрукций, регламентов и другой документации)иях (UML, BPMN)
        Подготовка обучающих материалов, презентация возможностей систем, проведение обучения функционалу, консультирование в рамках своей зоны ответственности, разработка инструкций.
Способна работать в условиях удаленного офиса, всегда в приоритет ставлю задачи и цели компании, всегда проверяю данные для достижения большей эффективности. Готова изучать новое в своей профессиональной деятельности для того, чтобы быть максимально полезной, способна к быстрому обучению. Обладаю аналитическим мышлением, способна как видеть целое, так и декомпозировать. 
Ищу работу на позиции middle в формате онлайн и гибрид.

Основная причина смены деятельности - желание объединить увлечение программированием и свою рабочую деятельность.
- заниматься программированием начал 2 года назад с обучения на платформе JavaRash, посещения мастер -классов от Университета Иннополис, а также участия в online-митапах от компании Luxoft.
- закончил 4 курса: 2 - от Coursera (Основы Котлин и Java for Android) и 2 курса от Университета Иннополис (Основы программирования и Разработчик ПО с применением технологий Java EE).
- в рамках обучения в Университете Иннополис был реализован командный курсовой проект: портал по поиску работы "JOBsearch". Реализованы два сценария взаимодействия: со стороны соискателя и со стороны работодателя. Использован стек технологий: Java 8, Spring (Boot, MVC, Security), REST API, PostgrySQL, Liquibase, Hibernate, Lombok,Thymeleaf, HTML5, CSS, Bootstrap 4, Apache Tomcat.

Ссылка на github:
https://github.com/ZhuravlyovAlex?tab=repositories

- целеустремлен, легко обучаем, cпособен работать с большими объемами информации. Умею достигать поставленной цели.

За время трудовой деятельности приобрел следующие навыки:
- опыт формирования команды и управления коллективом;
- опыт организации процесса и контроля выполнения поставленных бизнес - задач;
- опыт проведения переговоров с первыми лицами предприятий;
- планирование деятельности и организация работы отдела с «нуля»;
- сбор и анализ информации о конкурентах и о текущем состоянии рыночной ситуации в регионе;
- навык разрешения конфликтных ситуаций;

Over 18 years of experience working with various IT tools/IT technology. More than 10 years of work on the management of development and projects. Experience in implementing large projects from the survey stage to the operation stage with a cost of more than $ 1 million.

Areas of interest:
•	Internet (AD/provider);
•	Telecommunications;
•	Production;

Main base skills:
•	Development team management;
•	Project management;
•	Architect IT/BigData/DWH;
•	Analyst;
•	Programming, Development;

Main duties:
•	Development of BigData/DWH direction;
•	Development of new products and services created using the BigData/DWH platform;
•	Project management for the development of BigData/DWH products (decomposition of tasks, resource and budget planning, formulation and monitoring of task execution, preparation of presentations and justification);
•	Budget planning, competency management within the activity area;
•	Preparing feasibility studies for solution selection;
•	Communication with external Customers on the use and development of BigData/DWH services;
•	Products audit and testing, preparation of reports;
•	Data analysis (operational, predictive analytics);
•	Development of requirements for corporate data storage system and development of the Data Lake/DWH architecture (data lake, data storage, processing and analysis system);
•	Development of the architecture BigData/DWH products, services;
•	Knowledge of business economics;
•	Organization of processes (business, technological);
•	Knowledge and ability to apply practices Agile and PMBok;
•	Conducting training on professional products;
•       Organization of the team;
•       Development of the team and each member of the team;
